import ReactEcharts from "echarts-for-react";
import React from "react";
import { Col, Row } from 'antd';
import {optionVizScatter1, optionVizScatter2, optionVizScatter3, optionVizScatter4, optionVizScatter5, optionVizScatter6, optionVizScatter7, optionVizScatter8, optionVizScatter9, optionVizScatter10, optionVizScatter11, optionVizScatter12, optionVizScatter13, optionVizScatter14, optionVizScatter15, optionVizScatter16} from "./chart_options";


export function VizScatter_test (data: number[][][], height: string, fsize: number) {
    return (
        <div>
            <Row>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter1(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter5(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter9(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter13(data, fsize)}
                    />
                </Col>
            </Row>

            <Row>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter2(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter6(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter10(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter14(data, fsize)}
                    />
                </Col>
            </Row>

            <Row>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter3(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter7(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter11(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter15(data, fsize)}
                    />
                </Col>
            </Row>

            <Row>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter4(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter8(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter12(data, fsize)}
                    />
                </Col>
                <Col span={6}>
                    <ReactEcharts
                        style={{height: height}}
                        option={optionVizScatter16(data, fsize)}
                    />
                </Col>
            </Row>
        </div>
    )
}
